    def Encrypt_ID(self, id):
        try:
            number = int(id)
            encoded_bytes = []
            while True:
                byte = number & 0x7F   
                number >>= 7
                if number:
                    byte |= 0x80     
                encoded_bytes.append(byte)
                if not number:
                    break

            return ''.join(f'{b:02x}' for b in encoded_bytes)

        except Exception as e:
            print("فشل التشفير:", e)
            return None
      


